74gのスタイリッシュなポケットに入れても重く感じないバッテリーです。<br>2000mAhの容量なのでスマートフォン、iPhoneを1回程度充電できます。<br>バッテリー本体の充電時間は、約2.5時間で満充電となります。<<br><br><br>■商品詳細<br><table width=630 border=1 cellspacing=0><tr><td bgcolor=#ffffcc><p style=margin:10px;>メーカー名：ロモス<br>型番：PH10-403JP<br>JAN：4533239026573<br><br>購入単位：1個<br>配送種別：在庫品</p></td></tr></table><br><br>■型番：PH10-403JP JAN 4533239026573<br>■バッテリー容量：3.7V / 2000mAh （最大）<br>■バッテリータイプ：リチウムイオン<br>■入力：DC：5V 1A（最大）<br>■USB出力：DC：5V 1A（最大）<br>■本体寸法：90 x 30 x 21mm<br>■本体重量：74g<br>■動作温度：本体充電時 0℃～45℃　利用時 -10℃～60℃<br>■セルメーカー：中国<br>■本体充電時間：約2.5時間(5V、1A)<br>■安全回路：過充電制御、過電流制御、過電力制御、過電圧制御、回路ショート制御、温度制御<br>■保証期間：6ヶ月<br>■付属品：microUSBケーブル、保証書、取扱説明書（多国語対応　日本語あり）<br><br>※数量限定のため、先着順での販売となります。<br>ご注文のタイミングによっては、完売となっている場合がございます。<br>その際はキャンセル扱いとさせていただきますので、予めご了承下さい。<br><br><br><table width=600 border=0 cellspacing=0><tr><td><font size=1>【検索用キーワード】<br>楽天 通販 FM8088 M02L 2615BK DEM02L2615BK スマホ充電器 スマホ用充電器 充電器 ロモス 軽量モバイルバッテリー スマートフォン用モバイルバッテリー 2000mAh ブラック VOL18PC</font></td></tr></table><style type="text/css">
